import React, { Component } from 'react';
import Carousel from 'antd/es/carousel';
import KDYK from '../img/kdyk.jpg'
import KRK from '../img/krk.jpg'
import KMK from '../img/kmk.jpg'
export default class Ant extends Component {
    state={
        imgs:[{ source:KRK,alt:"科洛克",urls:"https://www.skoda.com.cn/kamiq/index.html"},
        { source:KRK,alt:"柯迪亚克",urls:"https://www.skoda.com.cn/kamiq/index.html"},
        { source:KRK,alt:"科米克",urls:"https://www.skoda.com.cn/kamiq/index.html"}
    ]
    }
    onclick(){
        console.log();
    }
    render() {
        return (
            <div className="App">
                <Carousel autoplay effect="fade" dotPosition="bottom">
                    <div>
                        <img src={KDYK} alt={"KDYK"}></img>
                        <span>1</span>
                    </div>
                    <div>
                        <img src={KRK} alt={"KRK"}></img>
                        <span>2</span>
                    </div>
                    <div>
                        <img src={KMK} alt={"KMK"}></img>
                        <span>3</span>
                    </div>
                </Carousel>
            </div>
        );
    }
}
